import { Container, makeStyles, Typography } from '@material-ui/core';
import { FC } from 'react';
import { Header } from '../components/Header';

const useStyles = makeStyles((theme) => ({
  image: {
    maxHeight: '100%',
    minWidth: '100%',
    objectFit: 'cover',
    verticalAlign: 'bottom',
  },
  imageContainer: {
    display: 'flex',
    height: '25vh',
    flexGrow: 1,
  },
}));

const Home: FC = () => {
  const classes = useStyles();

  return (
    <>
      <Header />
      <div className={classes.imageContainer}>
        <img
          src="https://images.unsplash.com/photo-1521295121783-8a321d551ad2?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60"
          alt="wannabi.in"
          className={classes.image}
        />
      </div>
      <Container maxWidth="md">
        <Typography variant="h6" component="h1">
          We all dream of being in other places
        </Typography>
        <Typography variant="caption">What is the place where you would rather be</Typography>
      </Container>
    </>
  );
};

export default Home;
